window.bookSummaryJSON = "<p><b>You take out one annoying vampire in revenge, and now you have to clean up the mess? What a pain in the...something.</b></p> <p>Bethany Anne and crew are back! They need to grab a ship, figure out who is trying to dig into her businesses, get their hands around the potential for creating an A.I. and the ongoing mess with Anton and South America.</p> <p>One of these days, she will get a break. Fortunately for us, it wasn't today. </p> <p>Got an attitude? That's nice. Just don't show it around Bethany Anne. When she slaps a face off, the whole head goes with it. </p> <p>Performed by Colleen Delany, Emily Beresford, Michael John Casey, James Konicek, Bianca Bryan, Danny Gavigan, Bradley Smith, Jonathan Lee Taylor, Patrick Bussink, Terence Aselford, Christopher Graybill, Matthew Bassett, Matthew Schleigh, Henry Kramer, Nora Achrati, Yasmin Tuazon, Steve Wannall, Stephon Walker, Zeke Alton, Chris Stinson, Chris Davenport, Torian Brackett, Emlyn McFarland, Ken Jackson, Darius Johnson, Nazia Chaudhry, Marni Penning, Shanta Parasuraman, Mort Shelby, Rose Elizabeth Supan, James Lewis, Carolyn Kashner, Eric Messner, Jason Keller, Alejandro Ruiz, Joel David Santner, Christopher Walker, Robb Moreira, and Christopher Williams.</p>"; 
